package com.example.demo.domain;

import java.util.Date;

public class Manager{	private Integer id;	private Date createTime;	private Date updateTime;	private Integer deleted;	private String name;	private String loginName;	private String password;	private String phone;	private Integer permissionId;	public Manager() {
		super();	}
	public void setId(Integer id){		this.id=id;	}	public Integer getId(){		return this.id;	}	public void setCreateTime(Date createTime){		this.createTime=createTime;	}	public Date getCreateTime(){		return this.createTime;	}	public void setUpdateTime(Date updateTime){		this.updateTime=updateTime;	}	public Date getUpdateTime(){		return this.updateTime;	} 	 public void setDeleted(Integer deleted){ 		 this.deleted=deleted; 	 } 	 public Integer getDeleted(){ 		 return this.deleted; 	 } 	 public void setName(String name){ 		 this.name=name; 	 } 	 public String getName(){ 		 return this.name; 	 } 	 public void setLoginName(String loginName){ 		 this.loginName=loginName; 	 } 	 public String getLoginName(){ 		 return this.loginName; 	 } 	 public void setPassword(String password){ 		 this.password=password; 	 } 	 public String getPassword(){ 		 return this.password; 	 } 	 public void setPhone(String phone){ 		 this.phone=phone; 	 } 	 public String getPhone(){ 		 return this.phone; 	 } 	 public void setPermissionId(Integer permissionId){ 		 this.permissionId=permissionId; 	 } 	 public Integer getPermissionId(){ 		 return this.permissionId; 	 }
}